// Dit groovy script wordt gebruikt om totalen te berekenen. Dit wordt gedaan door alle gegevens in een lijst op te nemen

// die behoren tot 1 en dezelfde groep. De groepen zijn:

// - inkomen

// - uitgaven

// - schulden (bij Schulden in berichtenboek

// - rekeningen saldo begin (Bij bezittingen)

// - rekeningen saldo einde (Bij bezittingen)

// - schulden saldo begin (Bij Schulden, veld Schuldeisers)

// - schulden saldo einde (Bij Schulden, veld Schuldeisers)

//  Tevens wordt het, liquide vermogen (=inkomen-uitgaven)   en het verschil tussen de rekeningen saldo einddatum - begindatum en afwijking totalen bepaald

//

// Interface

// Input: Volledige envelope van de haalOp verslag,

//

// Opmerking: ik heb nog geen tijd gehad om uit te zoeken of je een kleindere XML kunt aanleveren (een deel van de envelope). Namespacing was een probleem

//

// Werking

// Per categorie van gegevens is er een list aanwezig met alle gegevens identificaties die tot die groep behoren

// Van de ingelezen Xml wordt een map gemaakt met als key de identificatie van een gegeven en als waarde het getal

// Daarnaast zijn er getallen die bij een lijstgegeven horen. Hiervoor wordt de bijbehorende identificatie genomen en deze wordt geconcateneerd met een ; en een volgnummer van 1 tm 5

// --> BELANGRIJK: Er wordt dus vanuit gegaan dat er maximaal 5 lijstgegevens zijn en dat deze ook van volgnummer 1 tm 5 lopen

//

// Output:

// De gegevens zoals hierboven opgenomen

//

// 20-02-2019: Ed van Asseldonk:

// Aangemaakt



