def xmlMap = [:]



// Van de ingelezen Xml wordt een map gemaakt met als key de identificatie van een gegeven en als waarde het getal

rootNode.Body.HaalOpResponse.HaalOpResult.Formulier.Waarden.Gegeven.each {                   

            if (it.Waarde.Getal != "" )            {

                        gegeven = it.Identificatie.toString()

                        waarde = it.Waarde.Getal.toString()

              xmlMap.put(gegeven,waarde)

            }

}



// Daarnaast zijn er getallen die bij een lijstgegeven horen. Hiervoor wordt de bijbehorende identificatie genomen en deze wordt geconcateneerd met een ; en een volgnummer van 1 tm 5

rootNode.Body.HaalOpResponse.HaalOpResult.Formulier.Waarden.Gegeven.Waarde.Regels.LijstRegel.Gegevens.Gegeven.each {

            if (it.Waarde.Getal.toString() != ""  &&  it.Identificatie.toString() != "") {

                        gegeven = it.Identificatie.toString()+";"+it.parent().parent().Regelnummer.toString()

                        waarde =  it.Waarde.Getal.toString()      

                        xmlMap.put(gegeven,waarde)

            }

}



